import React, {Component} from "react";
import {i} from 'element-react';
class Addto extends Component {
    constructor() {
        super();
        this.state = {}
    }

    render() {
        return (
            <div className={"addto"}>
            <i className="el-icon-plus"></i>
            </div>
        )}

}

export default Addto ;
